import React, { Component } from "react";
import { Text, StyleSheet, View } from "react-native";

const CounterScreen = () => {
  return (
    <View>
      <Text>Counter</Text>
    </View>
  );
};

const styles = StyleSheet.create({});

export default CounterScreen;
